export function Rows({userCel,userId,userName}){
    return(
        <div>
            <tr>
                <td>{userId}</td>
                <td>{userName}</td>
                <td>{userCel}</td>
            </tr>
        </div>
    );
}

    export default function Table(){
        return(
            <div className="container-fluid p-5 mt-3 w-70" >
                <table className="table table-hover  "> 
                    <thead className='table-info'>    
                        <th scope="col">id</th>
                        <th scope="col">nombre</th>
                        <th scope="col">telefono celular</th>
                    </thead>
                    <tbody className='tabler-light'>
                        <Rows/>
                    </tbody>                   
                </table>
            </div>
        );

    }
